using AdventCalendar.Day5;
using Xunit;

namespace AdventCalendar.Tests.Day5
{
    public class Day5Part1Tests
    {
        string actualData = "";

        [Fact]
        public void ActualTest()
        {
            var result = PolymerReactionManager.React(actualData);

            Assert.Equal(11476, result.Length);
        }

        [Fact]
        public void aabAABIsValid()
        {
            var sampleData = "aabAAB";

            var result = PolymerReactionManager.React(sampleData);

            Assert.Equal(6, result.Length);
            Assert.Equal("aabAAB", result);
        }

        [Fact]
        public void abABIsValid()
        {
            var sampleData = "abAB";

            var result = PolymerReactionManager.React(sampleData);

            Assert.Equal(4, result.Length);
            Assert.Equal("abAB", result);
        }

        [Fact]
        public void AbBaIsInvalid()
        {
            var sampleData = "AbBa";

            var result = PolymerReactionManager.React(sampleData);

            Assert.Equal(0, result.Length);
            Assert.Equal("", result);
        }


        [Fact]
        public void AbCIsValid()
        {
            var sampleData = "AbC";

            var result = PolymerReactionManager.React(sampleData);

            Assert.Equal(3, result.Length);
            Assert.Equal("AbC", result);
        }

        [Fact]
