        {
            var sampleData = "Abc";

            var result = PolymerReactionManager.React(sampleData);

            Assert.Equal(3, result.Length);
            Assert.Equal("Abc", result);
        }

        [Fact]
        public void AAIsValid()
        {
            var sampleData = "AA";

            var result = PolymerReactionManager.React(sampleData);

            Assert.Equal(2, result.Length);
            Assert.Equal("AA", result);
        }

