        {
            var sampleData = "Aa";

            var result = PolymerReactionManager.React(sampleData);

            Assert.Equal(0, result.Length);
            Assert.Equal("", result);
        }

        [Fact]
        public void SampleDataMatches()
        {
            var sampleData = "dabAcCaCBAcCcaDA";

            var result = PolymerReactionManager.React(sampleData);

            Assert.Equal(10, result.Length);
            Assert.Equal("dabCBAcaDA", result);
        }
